import { render } from "@testing-library/react";
// import React from "react";
import React, { Component } from "react";
import BeforeAfterSlider from 'react-before-after-slider';
import Testimonial from 'react-testimonial';
//import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import {PricingTable, PricingSlot, PricingDetail} from 'react-pricing-table';
import { Card, CardHeader, CardBody, CardFooter } from 'react-simple-card';
import Slider from "react-slick";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader

function Blog() {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
    return (
        <div className="blogs">
            <div className="">
                 <img src="assets/images/our_blogs.jpg" height="80%" width="100%"/>
            </div>

            <div class="container" style={{marginTop:"5%"}}>
                    <div class="row">
                        <div class="col-md-7">
                            <Slider {...settings}>
                            <div>
                            <img src="assets/images/our_blogs.jpg" height="100%" width="100%"/>
                            </div>
                            <div>
                            <img src="assets/images/our_blogs.jpg" height="100%" width="100%"/>
                            </div>
                            <div>
                            <img src="assets/images/our_blogs.jpg" height="100%" width="100%"/>
                            </div>
                            </Slider>
                        </div>

                        <div class="col-md-5">
                           <div class="row-md-6">
                           <img src="assets/images/our_blogs.jpg" height="100%" width="100%"/>
                           </div>
                           <div class="row-md-6">
                           <img src="assets/images/our_blogs.jpg" height="100%" width="100%"/>
                            </div>

                        </div>
                    </div>
            </div>

            <div class="container">
                <h1 style={{textAlign:"center",marginTop:"6%",fontFamily:"poppins",fontWeight:"400"}}>OUR FEATURED BLOGS</h1>
            </div>

            <br/>
        </div>

    );
}

export default Blog;
